INSERT INTO `secciones` (`id`, `titulo`, `texto`, `imagen`, `link`, `textoboton`, `seccion`, `updated_at`) VALUES
	(1, 'Quienes somos', '<p><font color="#ffffff"><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjE0MDQ4OTc4MDcsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space-collapse: preserve;">Real Química es una empresa de raíz</span></font></p><p><span style="white-space-collapse: preserve;"><font color="#ffffff">electroquímica y su nombre original al comienzo de</font></span></p><p><span style="white-space-collapse: preserve;"><font color="#ffffff">sus actividades fue Laboratorio Argentino de </font></span></p><p><span style="white-space-collapse: preserve;"><font color="#ffffff">Investigación Galvanotécnica.</font></span></p><p><br></p><p><span style="white-space-collapse: preserve;"><font color="#ffffff"><br>Fundada 1973, su principal objetivo fue el de llevar</font></span></p><p><span style="white-space-collapse: preserve;"><font color="#ffffff">la avanzada en la investigación, el desarrollo, y la </font></span></p><p><span style="white-space-collapse: preserve;"><font color="#ffffff">puesta en marcha de nuevas tecnologías para el </font></span></p><p><span style="white-space-collapse: preserve;"><font color="#ffffff">tratamiento de superficies; manifestando una </font></span></p><p><span style="white-space-collapse: preserve;"><font color="#ffffff">marcada vocación de para el desarrollo de la </font></span></p><p><span style="white-space-collapse: preserve;"><font color="#ffffff">industria nacional.</font></span><br><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjEwOTExMjg2MzEsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->"></span></p>', 'fotos/nR5rMb6rAsiUrcxyebSyqUYDtruUwwqyvCPEHfOx.png', 'undefined', 'undefined', 'home', '2024-05-27 14:30:52'),
	(2, 'Fasón', '<p><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiUzh4cFJxSmNsY3pDWGNRcFo0ckQxbSIsInBhc3RlSUQiOjY5NzU5NDIxOCwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->"></span><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjE0NDI0NTY0MjgsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space-collapse: preserve;">Poseemos una planta industrial que cuenta con modernas instalaciones, </span></p><p><span style="white-space-collapse: preserve;">adecuadas para la fabricación de todo tipo de productos químicos.</span></p><p><span style="white-space-collapse: preserve;">Reactores en acero inoxidable y fibra de vidrio, desde 3500, con </span></p><p><span style="white-space-collapse: preserve;">agitación y posibilidades para el calentamiento y/o enfriamiento.</span></p><p><span style="white-space-collapse: preserve;"><br></span></p><p><span style="white-space-collapse: preserve;"><br><br>Las alternativas de trabajo para la fabricación por orden de terceros se </span></p><p><span style="white-space-collapse: preserve;">adecuan a las necesidades de cada cliente y pueden incluir, no sólo la </span></p><p><span style="white-space-collapse: preserve;">fabricación, sino también la provisión de materias primas, el servicio de </span></p><p><span style="white-space-collapse: preserve;">depósito, la logística para las entregas, los controles de laboratorio.</span></p><p><span style="white-space-collapse: preserve;">Todo nuestro servicio de fasón está contemplado en nuestro sistema de </span></p><p><span style="white-space-collapse: preserve;">calidad y gestión ambiental.</span><span style="white-space-collapse: preserve;"><br></span></p>', 'fotos/B9v6U0HzVbJXU69Atn93CyY5F02nC7W6EYr6kSfY.png', 'undefined', 'undefined', 'servicio1', '2024-05-27 18:12:21'),
	(3, 'Formulación y Desarrollo de producto', '<p><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjc4NDczODY2OCwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space-collapse: preserve;">El departamento ejecuta tareas relacionadas con el apoyo técnico y </span></p><p><span style="white-space-collapse: preserve;">da asesoramiento sobre las características, usos, pruebas y puesta </span></p><p><span style="white-space-collapse: preserve;">en marcha de cada unos de los producto que sean utilizados por </span></p><p><span style="white-space-collapse: preserve;">nuestros clientes.</span></p><p><span style="white-space-collapse: preserve;"><br></span></p><p><span style="white-space-collapse: preserve;"><br><br>Los clientes pueden ponerse en contacto con nuestro departamento de</span></p><p><span style="white-space-collapse: preserve;">Asistencia Técnica "cuando lo consideren necesario" y recibirán </span></p><p><span style="white-space-collapse: preserve;">asistencia continua hasta la resolución del problema.</span></p>', 'fotos/JvRCk7zuIIzot2h8WMk7XIF2ZuRgPUtASbqFLpOo.png', 'undefined', 'undefined', 'servicio2', '2024-05-27 18:24:29'),
	(4, 'Sobre nosotros', '<p><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjE4NDQyMDIxODUsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space-collapse: preserve;">Real Quimica es una empresa de raíz electroquímica y su nombre </span></p><p><span style="white-space-collapse: preserve;">original al comienzo de sus actividades fue Laboratorio Argentino de </span></p><p><span style="white-space-collapse: preserve;">Investigación Galvanotécnica.</span></p><p><span style="white-space-collapse: preserve;">Fundada 1973, su principal objetivo fue el de llevar la avanzada en la </span></p><p><span style="white-space-collapse: preserve;">investigación, el desarrollo, y la puesta en marcha de nuevas </span></p><p><span style="white-space-collapse: preserve;">tecnologías para el tratamiento de superficies; manifestando una</span></p><p><span style="white-space-collapse: preserve;">marcada vocación de para el desarrollo de la industria nacional.</span></p><p><span style="white-space-collapse: preserve;"><br><br>La innovación tecnológica, la responsabilidad social, la sustentabilidad </span></p><p><span style="white-space-collapse: preserve;">ambiental y un decidido compromiso en búsqueda de la excelencia para </span></p><p><span style="white-space-collapse: preserve;">la implementación de sus procesos son las premisas que nos guían.<br></span></p>', 'fotos/TsaaDKcmaS0oAiE8WJKmKhKqMZtkLEFLk9rHoMF4.png', 'undefined', 'undefined', 'nosotros', '2024-05-27 18:04:52'),
	(5, 'Laboratorio de calidad', '<p><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjkzMTk3OTMwLCJkYXRhVHlwZSI6InNjZW5lIn0K(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space-collapse: preserve;">Nuestro laboratorio cuenta con equipamiento de última generación </span></p><p><span style="white-space-collapse: preserve;">que responde a estrictas normas de calidad y se encuentran al servicio </span></p><p><span style="white-space-collapse: preserve;">de nuestros clientes.</span></p><p><span style="white-space-collapse: preserve;"><br><br>Asimismo, contamos orgullosamente con un equipo de profesionales con </span></p><p><span style="white-space-collapse: preserve;">amplia y destacada experiencia en el desarrollo de productos dirigidos al </span></p><p><span style="white-space-collapse: preserve;">cuidado de la salud y cosmética capaz de interpretar y entender las </span></p><p><span style="white-space-collapse: preserve;">necesidades de cada cliente de modo de acompañarlos y sugerirles las </span></p><p><span style="white-space-collapse: preserve;">mejores alternativas de solución en productos de calidad, rentables y </span></p><p><span style="white-space-collapse: preserve;">acordes a los lineamientos requeridos.</span></p>', 'fotos/65cyOH74D7KaNB8APrV3TVTjCIyeIfhzuFnYhA34.jpg', 'fotos/oHE7GnbT7TsUFEWkHLEIOr0LDNwW99bNkIX46Ea2.txt', 'fotos/gqUiaK0DXViznEJ5JBMcs6kWiujIygvS8c9TLOb7.txt', 'calidad', '2024-05-27 19:44:44');

