INSERT INTO `valores` (`id`, `orden`, `file`, `titulo`, `updated_at`, `created_at`, `imagen`, `texto`) VALUES
	(7, 'aa', NULL, 'Misión', '2024-05-22 17:13:45', '2024-05-22 17:13:45', 'fotos/gejffYSjVng0yZJDI2QXSOuLBagK9YvqT2jDWcfy.png', '<p><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjk1OTQxNzY2NiwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space-collapse: preserve;">La innovación tecnológica, la responsabilidad social, la sustentabilidad ambiental y un decidido compromiso en búsqueda de la excelencia para la implementación de sus procesos son las premisas que nos guían.</span><br></p>'),
	(8, 'bb', NULL, 'Vísion', '2024-05-22 17:15:48', '2024-05-22 17:15:48', 'fotos/7bGFkYu5GDqAyoGhUDre7VZkTzssSMQBsffORzZk.png', 'Atentos a la evolución y necesidades de los mercados, hemos incorporado en los últimos años líneas alternativas compatibles con nuestra estructura, llegando con nuestra distribución a nivel nacional y Mercosur.'),
	(9, 'cc', NULL, 'Valores', '2024-05-22 17:18:01', '2024-05-22 17:18:01', 'fotos/YWJTBBwPkCmyDcZ7qmKgnnYNY5ABvm236YGcMfLI.png', '<p><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjIxMDE1MTQxNDksImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space-collapse: preserve;">Respecto de los sistemas de aseguramiento de la calidad, estamos trabajando desde 1987 con pautas de Calidad Total (TQC).<br>Estamos certificados por SGS Argentina en el cumplimiento de las normas ISO 9000 desde el año 2000.</span><br></p>');

